import React from "react";
import logo from "../images/logo.png";
import '../css/Home.css';
import Container from "react-bootstrap/Container";
import Flipper from "flipper"


const Home = React.memo(() => {
    return (
        <Container>
            <Flipper>
                <Front>
                    <img src={logo} className="home-shield" alt="logo"/>
                </Front>
                <Back>
                    <img src={logo} className="home-shield" alt="logo"/>
                </Back>
            </Flipper>
        </Container>
    )
});

export default Home
